import Table from "../../styled-components/Table";
import Typography from "../../styled-components/Typography";

export default function TableBottom({random_game, game_status}) {
  return (
    <Table bottom>
      {(game_status && random_game.answers) ? (
        random_game.answers.map(answer => <Typography answer href="/">{answer}</Typography>)
      ) : ``}
    </Table>
  );
}
